import React, { Component } from 'react'
import { Form, Group, Label, Control, Button, Check } from 'react-bootstrap'

export default class NewCat extends Component {
    constructor(props){
  super(props)
  this.state = {
    form:{
      name: '',
      age: '',
      enjoys: ''
    }
  }
}
    render() {
        return (
            <Form>
              <Form.Group controlId="name">
                <Form.Label>Name</Form.Label>
                <Form.Control type="text" placeholder="Enter name" />
              </Form.Group>

              <Form.Group controlId="age">
                <Form.Label>Age</Form.Label>
                <Form.Control type="number" placeholder="Enter age" />
              </Form.Group>

              <Form.Group controlId="enjoys">
                <Form.Label>Enjoys</Form.Label>
                <Form.Control type="text" placeholder="Enter enjoys" />
              </Form.Group>

              <Button variant="primary" type="submit">
                Create Cat Profile
              </Button>
            </Form>
        )
    }
}
